import axios from 'axios';

const API_URL = 'http://localhost:5000';

const EntradaStockService = {
  getAll: async () => {
    try {
      const res = await axios.get(`${API_URL}/entrada_stock`);
      return res.data;
    } catch (err) {
      return { entradas: [] };
    }
  }
};

export default EntradaStockService;
